 <head>
  <meta charset="utf-8"/>
  <meta content="width=device-width, initial-scale=1.0" name="viewport"/>
  <title>
   SVG Icon Collection
  </title>
  <style>
   body {
                display: inline-flex;
                flex-wrap: wrap;
                font-family: sans-serif;
                margin: 20px;
                background-color: #0d1117;
                justify-content: center;
            }

            .icon-container {
                justify-content: center;
                display: inline-flex;
                grid-template-columns: repeat(auto-fill, minmax(100px, 1fr));
                /* Responsive grid */
                gap: 20px;
                margin-top: 20px;
                border: 1px;
                border-color: aqua;
                border-radius: 12px;
                width: 90%;
                flex-wrap: wrap;
            }

            .icon-wrapper {
                display: flex;
                justify-content: center;
                align-items: center;
                padding: 10px;
                border: 1px solid #0d1117;
                border-radius: 9px;
                cursor: pointer;
                background-color: #09090a;
                transition: background-color 0.6s ease;
            }

            .icon-wrapper:hover {
                background-color: #181818;
            }

            .icon-wrapper svg {
                width: 48px;
                /* Adjust as needed */
                height: 48px;
                /* Adjust as needed */
            }

            .code-copied-message {
                position: fixed;
                top: 20px;
                left: 50%;
                transform: translateX(-50%);
                background-color: #4CAF50;
                color: white;
                padding: 10px 20px;
                border-radius: 5px;
                opacity: 0;
                transition: opacity 0.5s ease, visibility 0.5s ease;
                visibility: hidden;
                z-index: 1000;
            }

            .code-copied-message.show {
                opacity: 1;
                visibility: visible;
            }

            svg {
                opacity: 0.80;
                visibility: visible !important;
                color: rgb(226, 226, 226);
                transition: scale 0.8s ease;
            }

            svg:hover {
                opacity: 1;
                scale: 1.2;
                color: offwhite;
            }

            svg:active {
                color: #4CAF50;
            }

            h1,
            h2,
            h3,
            h4,
            h5,
            h6 {
                color: #84afe7;
                font-family: 'Arsenal SC', sans-serif;
                font-weight: bold;
            }
  </style>

  <style id="ms_style" type="text/css">
   #modern_scroll {
                all: initial !important;
            }

            html,
            body {
                scroll-behavior: auto !important;
            }

            html,
            body {
                scrollbar-width: none !important;
            }

            body *:not(:hover):not(:focus-within) {
                scrollbar-color: transparent transparent !important;
            }

            body * {
                scrollbar-color: var(--color, #0d1117) var(--color_bg, #0d1117) !important;
            }

            body *::-webkit-scrollbar-button {
                display: none;
            }

            body *::-webkit-scrollbar-track {
                background: none;
                box-shadow: inset 0 0 1px 1px var(--border_color) !important;
                border-radius: 1px;
            }

            body *::-webkit-scrollbar-thumb {
                background: var(--color, #0d1117);
                box-shadow: inset 0 0 1px 1px var(--border_color) !important;
                border-radius: 1px;
            }

            body *::-webkit-scrollbar-thumb:hover {
                background: var(--color, #0d1117);
            }
